import { Navigate, Outlet } from 'react-router'




const ProtectedRoutes = (props) => {


    useEffect(() => {
        console.log('user State', props.checkUser)

    }, [props.checkUser])


    return props.checkUser ? <Outlet /> : <Navigate to='/sign-in' />

}

export default ProtectedRoutes
